var n=(0,t.createTemplateFactory)({id:"UUh1mpm1",block:'[[[10,"h1"],[14,1,"design-system-glossary"],[14,0,"font-bold mb-4 heading-2xl"],[12],[1,"Design System Glossary"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"These terms are commonly used when talking about Design Systems. Some of these terms have many definitions that change with context. Our goal is to help provide a shared understanding of what we mean when we use these words in our work."],[13],[1,"\\n"],[10,"h4"],[14,1,"design-system"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Design System"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"A design system is a collection of reusable components, guided by clear standards, that can be assembled together to build any number of applications. Design systems are made up of documented patterns, visual properties, code snippets, and usage guidelines."],[13],[1,"\\n"],[10,"h4"],[14,1,"pattern-library"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Pattern Library"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"A subclass in the design system, this is the set of design patterns for use across a company."],[13],[1,"\\n"],[10,"h4"],[14,1,"style-guide"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Style Guide"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"Another subclass in the design system, this static documentation describes the design system itself: how products should look and feel, use cases for UI patterns, correct typographic scales, etc."],[13],[1,"\\n"],[10,"h4"],[14,1,"component"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Component"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"Interface element that can be reused across the Movable Ink system. Our components typically support both Ember.js and raw HTML/CSS. Components should be well documented, supported and tested across all modern browsers and be accessible to all."],[13],[1,"\\n"],[10,"h4"],[14,1,"element"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Element"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"Typically used to describe an HTML element. In our context, elements are the smallest base object in a document."],[13],[1,"\\n"],[10,"h4"],[14,1,"pattern"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Pattern"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"A formal way of documenting a general reusable solution to a design problem in the Movable Ink Platform."],[13],[1,"\\n"],[10,"h4"],[14,1,"design-tokens"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Design Tokens"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"Anything we see on a website is built from elements of style: elements like color, spacing, typography, line height, and opacity. The CSS rules associated with these elements can accept a broad continuum of values  in the case of color, there are over 16 million separate colors in the RGB color space. Font size, line height, spacing, and others can accept a similarly wide range of values.\\nThis degree of choice can slow down design work and make communication between designer and developer unnecessarily granular. USWDS seeks to maximize design efficiency and improve communication with design tokens: the discrete palettes of values from which we base all our visual design.\\nDesign tokens are a limited set of discrete options, just like a scale of musical notes is drawn from the spectrum of all possible frequencies. Or like the presets on a car radio  not every option, just a specific selection. - US Web Design Standards.\\nYou can think of a design token as a key that unlocks a specific value"],[13],[1,"\\n"],[10,"h4"],[14,1,"utilities"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Utilities"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"Utilities are simple HTML classes typically scoped to a single CSS property like background-color. Utilities can be used additively to style an object from scratch or to override a style defined in component CSS."],[13],[1,"\\n"],[10,"h4"],[14,1,"grid"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Grid"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"A framework made up of evenly divided, intersecting columns and rows. Grids help designers to align and arrange elements in a quicker, neater, and more consistent way.\\nScale\\nThe change of size of an object while keeping its shape and proportions intact. Large scale can create drama, and smaller scale can create fine detail."],[13],[1,"\\n"],[10,"h4"],[14,1,"whitespace"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Whitespace"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"Also called negative space, white space refers to the areas of a design that are not filled with content. White space is an important design element as it helps to let a design breathe, helps avoid overly complicated designs, and keeps designs looking clean."],[13],[1,"\\n"],[10,"h4"],[14,1,"brand"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Brand"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"A collection of concepts, ideas, and emotions that encapsulate your companys values and ethos. A brand is a mix of all the fine conceptual details that make up the company, from the content the brand promotes, the way employees talk, the words used, the values upheld, etc."],[13],[1,"\\n"],[10,"h4"],[14,1,"brandmark"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Brandmark"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"A type of logo design where a symbol is used in place of the company name, i.e. the Apple logo. Brandmarks are commonly accompanied by a logotype, but not always."],[13],[1,"\\n"],[10,"h4"],[14,1,"brand-identity"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Brand Identity"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"The visualization of your brand (see definition above) in a way that represents the values, content and ethos of the company. This can include things like a logo, business cards, letterheads, uniforms, packaging design, etc."],[13],[1,"\\n"],[10,"h4"],[14,1,"logotype"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Logotype"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"A type of logo where the name of the company designed in a visual way. Think of brands like Google, Ikea, Disney.\\nBug\\nA software bug is a problem causing a program to crash or produce an invalid output. Most bugs are due to human error."],[13],[1,"\\n"],[10,"h4"],[14,1,"chore"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Chore"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"An Item that provides value to the Team or Product, as opposed to an external Stakeholder; an Item whose value is other than Business Value."],[13],[1,"\\n"],[10,"h4"],[14,1,"feature"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Feature"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"A Feature is a service that fulfills a stakeholder need. Each feature includes a benefit hypothesis and acceptance criteria, and is sized or split as necessary to be delivered by a single team."],[13],[1,"\\n"],[10,"h4"],[14,1,"debt-design-or-tech"],[14,0,"font-bold mb-4 heading-md"],[12],[1,"Debt (Design or Tech)"],[13],[1,"\\n"],[10,2],[14,0,"body-base my-4"],[12],[1,"You have two ways of doing something. One will be quick, but come with trade offs. The second will take longer, but not add any debt. Debt is the extra time it will take to do the better option, having done the messy option."],[13]],[],false,[]]',moduleName:"dummy/templates/docs/help/glossary.hbs",isStrictMode:!1})
